Python thread cannot handle signals (if</span></pre></div>", ""], ["<a name=\"L1182\">1182</a>", "", "", "<div class=\"highlight\"><pre>    <span class=\"c1\">// _Py_ThreadCanHandleSignals() is false).</span></pre></div>", ""], ["<a name=\"L1183\">1183</a>", "", "", "<div class=\"highlight\"><pre>    <span class=\"n\">COMPUTE_EVAL_BREAKER</span><span class=\"p\">(</span><span class=\"n\">tstate</span><span class=\"o\">-&gt;</span><span class=\"n\">interp</span><span class=\"p\">,</span> <span class=\"n\">ceval</span><span class=\"p\">,</span> <span class=\"n\">ceval2</span><span class=\"p\">);</span></pre></div>", ""], ["<a name=\"L1184\">1184</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cp\">#endif</span></pre></div>", ""], ["<a name=\"L1185\">1185</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1186\">1186</a>", "", "", "<div class=\"highlight\"><pre>    <span class=\"k\">return</span> <span class=\"mi\">0</span><span class=\"p\">;</span></pre></div>", ""], ["<a name=\"L1187\">1187</a>", "", "", "<div class=\"highlight\"><pre><span class=\"p\">}</span></pre></div>", ""], ["<a name=\"L1188\">1188</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1189\">1189</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1190\">1190</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">/* Computed GOTOs, or</span></pre></div>", ""], ["<a name=\"L1191\">1191</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">       the-optimization-commonly-but-improperly-known-as-&quot;threaded code&quot;</span></pre></div>", ""], ["<a name=\"L1192\">1192</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   using gcc&#39;s labels-as-values extension</span></pre></div>", ""], ["<a name=\"L1193\">1193</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   (http://gcc.gnu.org/onlinedocs/gcc/Labels-as-Values.html).</span></pre></div>", ""], ["<a name=\"L1194\">1194</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1195\">1195</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   The traditional bytecode evaluation loop uses a &quot;switch&quot; statement, which</span></pre></div>", ""], ["<a name=\"L1196\">1196</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   decent compilers will optimize as a single indirect branch instruction</span></pre></div>", ""], ["<a name=\"L1197\">1197</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   combined with a lookup table of jump addresses. However, since the</span></pre></div>", ""], ["<a name=\"L1198\">1198</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   indirect jump instruction is shared by all opcodes, the CPU will have a</span></pre></div>", ""], ["<a name=\"L1199\">1199</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   hard time making the right prediction for where to jump next (actually,</span></pre></div>", ""], ["<a name=\"L1200\">1200</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   it will be always wrong except in the uncommon case of a sequence of</span></pre></div>", ""], ["<a name=\"L1201\">1201</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   several identical opcodes).</span></pre></div>", ""], ["<a name=\"L1202\">1202</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1203\">1203</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   &quot;Threaded code&quot; in contrast, uses an explicit jump table and an explicit</span></pre></div>", ""], ["<a name=\"L1204\">1204</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   indirect jump instruction at the end of each opcode. Since the jump</span></pre></div>", ""], ["<a name=\"L1205\">1205</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   instruction is at a different address for each opcode, the CPU will make a</span></pre></div>", ""], ["<a name=\"L1206\">1206</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   separate prediction for each of these instructions, which is equivalent to</span></pre></div>", ""], ["<a name=\"L1207\">1207</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   predicting the second opcode of each opcode pair. These predictions have</span></pre></div>", ""], ["<a name=\"L1208\">1208</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   a much better chance to turn out valid, especially in small bytecode loops.</span></pre></div>", ""], ["<a name=\"L1209\">1209</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1210\">1210</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   A mispredicted branch on a modern CPU flushes the whole pipeline and</span></pre></div>", ""], ["<a name=\"L1211\">1211</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   can cost several CPU cycles (depending on the pipeline depth),</span></pre></div>", ""], ["<a name=\"L1212\">1212</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   and potentially many more instructions (depending on the pipeline width).</span></pre></div>", ""], ["<a name=\"L1213\">1213</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   A correctly predicted branch, however, is nearly free.</span></pre></div>", ""], ["<a name=\"L1214\">1214</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1215\">1215</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   At the time of this writing, the &quot;threaded code&quot; version is up to 15-20%</span></pre></div>", ""], ["<a name=\"L1216\">1216</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   faster than the normal &quot;switch&quot; version, depending on the compiler and the</span></pre></div>", ""], ["<a name=\"L1217\">1217</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   CPU architecture.</span></pre></div>", ""], ["<a name=\"L1218\">1218</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1219\">1219</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   NOTE: care must be taken that the compiler doesn&#39;t try to &quot;optimize&quot; the</span></pre></div>", ""], ["<a name=\"L1220\">1220</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   indirect jumps by sharing them between all opcodes. Such optimizations</span></pre></div>", ""], ["<a name=\"L1221\">1221</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   can be disabled on gcc by using the -fno-gcse flag (or possibly</span></pre></div>", ""], ["<a name=\"L1222\">1222</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">   -fno-crossjumping).</span></pre></div>", ""], ["<a name=\"L1223\">1223</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">*/</span></pre></div>", ""], ["<a name=\"L1224\">1224</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1225\">1225</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\">/* Use macros rather than inline functions, to make it as clear as possible</span></pre></div>", ""], ["<a name=\"L1226\">1226</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * to the C compiler that the tracing check is a simple test then branch.</span></pre></div>", ""], ["<a name=\"L1227\">1227</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * We want to be sure that the compiler knows this before it generates</span></pre></div>", ""], ["<a name=\"L1228\">1228</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> * the CFG.</span></pre></div>", ""], ["<a name=\"L1229\">1229</a>", "", "", "<div class=\"highlight\"><pre><span class=\"cm\"> */</span></pre></div>", ""], ["<a name=\"L1230\">1230</a>", "", "", "<div class=\"highlight\"><pre></pre></div>", ""], ["<a name=\"L1231\" function toggleExpandedMessage(e) {
  var FullTextElems = e.parentElement.parentElement.getElementsByClassName("full-info");
  if (!FullTextElems || FullTextElems.length < 1) {
      return false;
  }
  var FullText = FullTextElems[0];
  if (FullText.style.display == 'none') {
    e.innerHTML = '-';
    FullText.style.display = 'block';
  } else {
    e.innerHTML = '+';
    FullText.style.display = 'none';
  }
}
